package com.company;

import java.util.HashMap;
import java.util.Map;

/**
 * Created by pshivra on 5/21/2018.
 */
public class StringAnagrams {

    public static void main(String args[]){
        String abc = "";
        String dca = "";

        //TODO : a,d,e,f,k,i,o,p
        char[] firstStringCharArray = abc.toCharArray();
        char[] secondStringCharArray = dca.toCharArray();

        Map<Character,Integer> anamolies = new HashMap<>();

        check(firstStringCharArray, dca, anamolies);
        check(secondStringCharArray, abc , anamolies);

        System.out.println(anamolies.values().stream().mapToInt(Number::intValue).sum());
    }

    private static void check(char[] checkAgainst, String stringToBeChecked , Map anamolies){

        for(char i : checkAgainst){
            boolean matches = stringToBeChecked.chars().anyMatch(x -> x == i);
            if(!matches){
                anamolies.putIfAbsent(i,0);
                anamolies.put(i,(Integer)anamolies.get(i)+1);
            }
        }
    }
}
